    false,nt"url": null,nt"notes": "This narrative report for Fish Springs
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1962. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, and collections and receipts. Resource
    management is outlined; topics include fur harvesting, peat mining, and frog farming.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, violations, and safety. Items of interest, N-R forms, and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
